import React from "react";
import AppLayout from "../components/AppLayout";
import { db } from "../firebaseConfig";

function index() {
    return (
        <AppLayout>
            <div>
                {db
                    .collection("product")
                    .get()
                    .then((res) => {
                        res.forEach((doc) => <div>{doc.data().name}</div>);
                    })}
            </div>
        </AppLayout>
    );
}

export default index;
